import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Container,Paper } from '@mui/material';

export default function Duenio() {
    const paperStyle={padding:'50px 20px ', width:600,margin: "20px auto"}
  return (
    <Container>
        <Paper elevation={3} style={paperStyle}>
        <Box
        component="form"
        sx={{
            '& > :not(style)': { m: 1},
        }}
        noValidate
        autoComplete="off"
        >
        <TextField id="standard-basic" label="Nombre" variant="standard" />
        <TextField id="standard-basic" label="Numero" variant="standard" />
        <TextField id="standard-basic" label="Cant Mascotas" variant="standard" fullw />
        <TextField id="standard-basic" label="Dirección" variant="standard" fullWidth/>
        </Box>
        </Paper>
    </Container>
  );
}
